import React from 'react'
import Avatar from '../components/Avatar'

function Home() {
  return (
    <main>
      <Avatar />
      <style>{`
        main {
          width: 100%;
          height: 100vh;
          background-color: #4d4855;
          background-image: linear-gradient(147deg, #4d4855 0%, #000000 74%);
          display: flex;
          justify-content: center;
          align-items: center;
        }
      `}</style>
      <style jsx global>{`
        body {
          height: 100vh;
        }
      `}</style>
    </main>
  )
}

export default Home
